import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const TeamMemberList = ({ onClose }) => {
  const navigate = useNavigate();
  const [teamMembers, setTeamMembers] = useState([
    {
      id: 1,
      name: "Mayeesha Musarrat",
      department: "CSE",
      email: "musarrat@gmail.com",
      contactNo: "01711846745",
      mistId: "202114040",
    },
    // Add more team members as needed
  ]);

  const onDaco15697181IconClick = () => {
    navigate("/view-member-page");
  };

  return (
    <div className="relative bg-white shadow-[0px_4px_100px_rgba(0,_0,_0,_0.25)] w-[1423px] h-[545px] overflow-y-scroll max-w-full max-h-full text-center text-5xl text-darkslategray-300 font-poppins">
      <label
        className="absolute top-[24px] left-[30px] font-archivo-black text-left inline-block w-[400px] h-[19px]"
        id="studentname"
      >
        Team Members
      </label>
      {/* Table container */}
      <div className="absolute top-[100px] left-[30px] w-[1340px] h-[375px] overflow-y-scroll">
        <table className="table">
          <thead>
            <tr>
              <th>Ser.</th>
              <th>Name</th>
              <th>Department</th>
              <th>Email</th>
              <th>Contact No.</th>
              <th>MIST_ID</th>
            </tr>
          </thead>
          <tbody>
            {teamMembers.map((member, index) => (
              <tr key={member.id}>
                <td>{index + 1}</td>
                <td>{member.name}</td>
                <td>{member.department}</td>
                <td>{member.email}</td>
                <td>{member.contactNo}</td>
                <td>{member.mistId}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <img
        className="absolute top-[20px] left-[1370px] w-5 h-5 object-cover cursor-pointer"
        alt=""
        src="/daco-1569718-1@2x.png"
        onClick={onDaco15697181IconClick}
      />
    </div>
  );
};

export default TeamMemberList;
